import React, { Component } from "react";
import TeamUserAvatar from "./team/TeamUserAvatar";
import { Link } from "react-router-dom";
import { Menu} from "semantic-ui-react";

class NavBar extends Component {
  render() {
    const { loggedIn, user, logout } = this.props;
    return (
      <div className="nav-bar">
        {loggedIn ? (
          <Menu color="blue" inverted widths={3}>
            <Menu.Item fitted as='image'>
              <img circular src={user.img_url} />
              {user.username}
            </Menu.Item>
            <Menu.Item>
              {team_name}
            </Menu.Item>
            <Menu.Item fitted>
              <Link textAlign="right" to="/login" onClick={logout}>
                Log Out
              </Link>
            </Menu.Item>
          </Menu>
        ) : null}
      </div>
    );
  }
}

export default NavBar;
